// Imports
    // Librarys
    import axios from "axios";
    import React, { useEffect, useState } from "react";
    import { Footer } from "../components/Footer";
    import {Header} from "../components/header/Header";
import bloqueHeaderImage from "../multimedia/bloqueHeader.png"

    // Styles
    import "./styles/reservaStyle.css"
    import "../components/styles/bloqueHeaderStyle.css"
import { useNavigate } from "react-router-dom";
    // Component 

    const CrearProducto = () => {

        const [ciudades, setCiudades] = useState([]);

        useEffect(() => {
          axios.get("http://localhost:8080/ciudades")
          .then( res => setCiudades(res.data))
        },[])

        const [ciudad, setCiudad] = useState("");

        const [jwt, setJwt] = useState({});

        useEffect(() => {
          const savedUser = localStorage.getItem('jwt');
          const parsedUser = savedUser ? JSON.parse(savedUser) : {};
          setJwt(parsedUser);

        }, []);


        const [datosCrearProducto, setDatosCrearProducto] = useState({
            titulo: "",
            ubicacion: "",
            descripcion: "",
            direccion: "",
            categoria: {
                id: ""
            },
            ciudad: {
                id: ""
            },
            caracteristicas: [],
            normasCasa: "",
            medidasSaludSeguridad: "",
            politicasCancelacion: ""
        });

        const navigate = useNavigate();

        const handleSubmit = (e) => {
            e.preventDefault();

            const crearProductoData = {

            }

            axios.post("http://localhost:8080/reservas/add", JSON.stringify(crearProductoData), {
                headers: {
                  'Content-Type': 'application/json',
                  'Authorization': `Bearer ${jwt}`
                }
              })
              .then(function (response) {
                console.log(response.data);
                if (response.status === 200) {
                  navigate("/reservaExitosa");
                }
              })
              .catch(function (error) {
                console.log(error);
              });
        }



        return(
            <React.Fragment>
                <Header />
                    <section>
                        <div className = "BloqueHeader_div"> 
                            <div>
                                <h2>Administracion</h2>
                            </div>
                            <img src = {bloqueHeaderImage} alt = "Icon <" /> 
                        </div>
                        <section className="crearPropiedad">
                        <h1>Crear Propiedad</h1>
                        <form className="formProducto" onSubmit={handleSubmit}>
                            <div className="principio">
                                <div className="principio_main">
                                    <div className="principio_bloque1">
                                        <p>Nombre de la propiedad</p>
                                        <input type="text"></input>
                                        <p>Direccion</p>
                                        <input type="text"></input> 
                                    </div>
                                    <div className="principio_bloque2">
                                        <p>Categoria</p>
                                        <select>
                                            <option>Hotel</option>
                                            <option>Hostel</option>
                                            <option>Departamento</option>
                                            <option>Bed & Breakfast</option>
                                        </select>
                                        <p>Ciudad</p>
                                        <select id='ciudades' onChange={(event) => setCiudad(event.target.value)}>
                                        <option value="" disabled hidden> A donde vamos? </option>
                                                {ciudades.map((value) => (
                                                    <option value={value.ciudad} key={value.id}>{value.ciudad}</option>
                                                ))}
                                        </select>
                                    </div>
                                </div>    
                                <div className="principio_bloque3"> 
                                    <p>Descripcion</p>
                                    <input type="text" placeholder="Escribe aqui"></input>
                                </div>
                            </div>
                            <div className="medio">
                                <h2>Agregar atributo</h2>
                                <div className="medio_main">
                                    <div className="medio_bloque1">
                                        <p>Nombre</p>
                                        <input type="text"></input>
                                    </div>
                                    <div className="medio_bloque2">
                                        <p>Icono</p>
                                        <input type="text"></input>
                                    </div>
                                    <button> + </button>
                                </div>    
                            </div>
                            <div className="medio2">
                                <h2>Politicas del producto</h2>
                                <div className="medio2_main">
                                    <div className="medio2_bloque1">
                                        <h4>Normas de la casa</h4>
                                        <p>Descripcion</p>
                                        <input type="text" placeholder="Escribir Aqui"></input>
                                    </div>
                                    <div className="medio2_bloque2">
                                        <h4>Salud y seguridad</h4>
                                        <p>Descripcion</p>
                                        <input type="text" placeholder="Escribir Aqui"></input>
                                    </div>
                                    <div className="medio2_bloque3"> 
                                        <h4>Politicas de cancelacion</h4>
                                        <p>Descripcion</p>
                                        <input type="text" placeholder="Escribir Aqui"></input>
                                    </div>
                                </div>
                            </div>
                            <div className="final">
                                <h2>Cargar imagenes</h2>
                                <div className="final_main">
                                    <input type="text" placeholder="url"></input>
                                    <button> + </button>
                                </div>

                            </div>
                            <button className="formProducto_crear">Crear</button>
                        </form>
                        </section>
                    </section> 
                <Footer />
            </React.Fragment>
        )
    }

    // Export
    export {CrearProducto}
